import React from "react";
 import { useState } from "react";
 import { playerData } from "../Data/PlayerData";

const TeamPage = () => {
    const [display, setDisplay] = useState("Senior");

    const filteredPlayers = playerData.filter(
        (player) => player.team_type === display
      );
    const goalkeepers = filteredPlayers.filter(
        (player) => player.position === 'Goalkeeper'
    )
    const fieldPlayers = filteredPlayers.filter(
        (player) => player.position === 'Field'
    )
    const shooterPlayers = filteredPlayers.filter(
        (player) => player.position === 'Shooter'
    )
    const wingPlayers = filteredPlayers.filter(
        (player) => player.position === 'Wing'
    )
    return (
        <div className="flex flex-col justify-between items-center text-gray-500 py-5">
            <div className="text-5xl font-bold underline decoration-green-500 py-10">
                Handbool Team SC
            </div>
            <div className="py-5">
                <button
                className={`button text-2xl px-4 font-bold border-b-4 ${
                    display === "Senior" ? "border-green-500" : ""
                } transition duration-300`}
                onClick={() => setDisplay("Senior")}
                >
                Senior
                </button>
                <button
                className={`button text-2xl px-4 font-bold border-b-4 ${
                    display === "U19" ? "border-green-500" : ""
                } transition duration-300`}
                onClick={() => setDisplay("U19")}
                >
                U19
                </button>
                <button
                className={`button text-2xl px-4 font-bold border-b-4 ${
                    display === "Backteam" ? "border-green-500" : ""
                } transition duration-300`}
                onClick={() => setDisplay("Backteam")}
                >
                Backteam
                </button>
            </div>

            <div className="w-full">
                <div className="text-5xl font-bold underline decoration-green-500 py-5">Goalkeeper</div>
            </div>


            <div className="flex flex-wrap p-5 border-4 border-green-500 w-full justify-center">
                {goalkeepers.map((player) => (
                    <div key={player.id} className="flex-shrink-0 w-1/3 p-4 ">
                    <div className="bg-white border border-gray-200  shadow">
                        <div className="flex flex-col items-center">
                        <img
                            className="w-48 h-48 m-3 rounded-full shadow-lg"
                            src={player.player_img}
                            alt={player.name}
                        />
                        <h5 className="mb-1 text-xl font-medium text-gray-900">{player.name + ' ' + player.surname}</h5>
                        {player.sponsor !== '' && (
                        <>
                            <span className="text-sm text-gray-500 dark:text-gray-400">Player Sponsor</span>
                            <div className="flex items-center justify-center">
                                <img src={player.sponsor} className="w-1/2" alt="Sponsor" />
                            </div>
                        </>
                        )}
                        </div>
                    </div>
                    </div>
                ))}
            </div>


            <div className="w-full">
                <div className="text-5xl font-bold underline decoration-green-500 py-5">Field</div>
            </div>

            <div className="flex flex-wrap p-5 border-4 border-green-500 w-full justify-center">
                {fieldPlayers.map((player) => (
                    <div key={player.id} className="flex-shrink-0 w-1/3 p-4 h-full">
                    <div className="bg-white border border-gray-200  shadow">
                        <div className="flex flex-col items-center">
                        <img
                            className="w-48 h-48 m-3 rounded-full shadow-lg"
                            src={player.player_img}
                            alt={player.name}
                        />
                        <h5 className="mb-1 text-xl font-medium text-gray-900">{player.name + ' ' + player.surname}</h5>
                        {player.sponsor !== '' && (
                        <>
                            <span className="text-sm text-gray-500 dark:text-gray-400">Player Sponsor</span>
                            <div className="flex items-center justify-center">
                                <img src={player.sponsor} className="w-1/2" alt="Sponsor" />
                            </div>
                        </>
                        )}
                        </div>
                    </div>
                    </div>
                ))}
            </div>

            <div className="w-full">
                <div className="text-5xl font-bold underline decoration-green-500 py-5">Shooter</div>
            </div>

            <div className="flex flex-wrap p-5 border-4 border-green-500 w-full justify-center">
                {shooterPlayers.map((player) => (
                    <div key={player.id} className="flex-shrink-0 w-1/3 p-4 ">
                    <div className="bg-white border border-gray-200  shadow">
                        <div className="flex flex-col items-center">
                        <img
                            className="w-48 h-48 m-3 rounded-full shadow-lg"
                            src={player.player_img}
                            alt={player.name}
                        />
                        <h5 className="mb-1 text-xl font-medium text-gray-900">{player.name + ' ' + player.surname}</h5>
                        {player.sponsor !== '' && (
                        <>
                            <span className="text-sm text-gray-500 dark:text-gray-400">Player Sponsor</span>
                            <div className="flex items-center justify-center">
                                <img src={player.sponsor} className="w-1/2" alt="Sponsor" />
                            </div>
                        </>
                        )}
                        </div>
                    </div>
                    </div>
                ))}
            </div>

            <div className="w-full">
                <div className="text-5xl font-bold underline decoration-green-500 py-5">Wing</div>
            </div>

            <div className="flex flex-wrap p-5 border-4 border-green-500 w-full justify-center">
                {wingPlayers.map((player) => (
                    <div key={player.id} className="flex-shrink-0 w-1/3 p-4 ">
                    <div className="bg-white border border-gray-200  shadow">
                        <div className="flex flex-col items-center">
                        <img
                            className="w-48 h-48 m-3 rounded-full shadow-lg"
                            src={player.player_img}
                            alt={player.name}
                        />
                        <h5 className="mb-1 text-xl font-medium text-gray-900">{player.name + ' ' + player.surname}</h5>
                        {player.sponsor !== '' && (
                        <>
                            <span className="text-sm text-gray-500 dark:text-gray-400">Player Sponsor</span>
                            <div className="flex items-center justify-center">
                                <img src={player.sponsor} className="w-1/2" alt="Sponsor" />
                            </div>
                        </>
                        )}
                        </div>
                    </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default TeamPage;
